import {HomeComponent} from "./home/home.component";
import {RouterModule, Routes} from "@angular/router";
import {NgModule} from "@angular/core";
import {ProductComponent} from "./product/product.component";
import {NotAuthorizedComponent} from "./not-authorized/not-authorized.component";
import {LimitedAccessComponent} from "./limited-access/limited-access.component";
import {AuthGuard} from "./auth.guard";
import {CheckCredentialsGuard} from "./check-credentials.guard";



const routes: Routes = [
  {path: '', component: HomeComponent},
  {path: 'product', component: ProductComponent, canActivate:[AuthGuard, CheckCredentialsGuard, LimitedAccessComponent]},
  {path: 'not-authorized', component: NotAuthorizedComponent},
  {path: 'limited-access', component: LimitedAccessComponent},
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {
}
